import React from 'react';
import { createUseStyles } from 'react-jss';

const PhotoListDetail = ({ urls, description }) => {
	const useStyles = createUseStyles({ grid: { width: '500px', height: 'auto' } });
	const renderDetail = () => {
		const classes = useStyles();
		return (
			<div>
				<img className={classes.grid} src={urls} alt={description} loading="lazy" />
			</div>
		);
	};

	if (urls) {
		return renderDetail();
	} else {
		return <span>No images yet</span>;
	}
};

export default PhotoListDetail;
